import { useState } from "react";
import { json, useNavigate } from "react-router-dom";

const Registration = () => {
  const [fname, setFname] = useState("");
  const [lname, setLname] = useState("");
  const [pass, setPass] = useState("");
  const [email, setEmail] = useState("");
  const [sign, setSign] = useState(false);
  //const [msg, setMsg] = useState("");

  const onChangefName = (e) => {
    setFname({ fname: e.target.value });
  };

  const onChangelName = (e) => {
    setLname({ lname: e.target.value });
  };

  // getting email from user
  const onChangeEmail = (e) => {
    setEmail({ email: e.target.value });
  };

  // getting password from user

  const onChangePass = (e) => {
    setPass({ pass: e.target.value });
  };

  const navigate = useNavigate();

  const handleSubmit = (e) => {
    e.preventDefault();

    const dataSubmit = {
      fname: fname,
      lname: lname,
      email: email,
      pass: pass,
    };
    console.log(dataSubmit);

    // connecting frontend to backend(signup form)
    const requestOptions = {
      method: 'POST',
      headers: {'Content-Type':'application/json'},
      body: JSON.stringify({fname,lname,email,pass})
    };

    fetch('http://localhost:8080/signup',requestOptions)
    .then(response => console.log('submitted'))
    .catch(error => console.log('form error',error))

  };

  return (
    <div className="col-md-6 offset-md-3">
      <h2>Sign Up</h2>
      <hr />

      <form onSubmit={handleSubmit}>
        <label>FirstName</label>
        <input
          type="text"
          name="fName"
          placeholder="Enter First Name"
          className="form-control"
          autoComplete="name-new"
          value={fname}p
          onChange={onChangefName}
          required
        />
        <br />
        <label>Last Name</label>
        <input
          type="text"
          name="lName"
          placeholder="Enter Last Name"
          className="form-control"
          autoComplete="name-new"
          value={lname}
          onChange={onChangelName}
          required
        />
        <br />
        <label >Email Address</label>
        <input
          type="email"
          name="email"
          placeholder="Enter Email Address"
          className="form-control"
          autoComplete="email-new"
          onChange={onChangeEmail}
          required
        />
        <br />
        <label >Password</label>
        <input
          type="password"
          name="pass"
          placeholder="Minimum 5 characters"
          minLength={5}
          className="form-control"
          autoComplete="password-new"
          onChange={onChangePass}
          required
        />
        <br />
        <label >Re-Enter Password</label>
        <input
          type="password"
          name="pass"
          minLength={5}
          className="form-control"
          autoComplete="password-new"
        />
        <br />
        <input
          type="submit"
          name="submit"
          className="btn btn-primary"
          value="Sign Up"
        />
      </form>
    </div>
  );
};

export default Registration;
